映画 怪盗グルーのミニオン危機一発　Despicable Me 2 ミニオン ジェリー  ぬいぐるみ　バックパック リュックサック9/14公開ユニバーサルスタジオ映画「怪盗グルーのミニオン危機一発」で大人気！ミニオン ジェリーのぬいぐるみバックパックです!!<br><br>

サイズ　約40cm<br><br>

後ろ側にポケットがついており、携帯電話やカード、小銭など小さいものでしたら収納可能です。<br><br>

とてもかわいいですよ☆プレゼントにピッタリ♪<br><br></DIV>
<style type="text/css">



/***買い物かごまわり全ボタン・入力欄共通
input{
background:url() no-repeat;
border:none;
}***/

/* お買い物かごボタンの大きさ */
td > input {
font-size: 12px;
font-weight:bold;
width: auto;
height:60px;
padding:18px 70px;
border:none;
color:#fff;
margin-top:0px; 
margin-bottom:15px;
background:url(http://image.rakuten.co.jp/mars405/cabinet/aw1412-/kago-btn.jpg) no-repeat;
}

/***「個数」部分***/
input#units{
border:solid #ccc 1px;
 color:#000;
background:#fff;
padding:8px 10px 8px 10px;
text-align:center;
margin-top:15px; margin-bottom:15px;
}

/***「お問合せ」ボタン
font input{
width:203px;
height:60px;
background:url() no-repeat;
padding:10px 10px 10px 52px;
margin-bottom:15px;
}***/

/***「項目選択肢部分」***/
.inventory input{
background:#fff;
}
/***「お気に入りショップ」***/
.favorite {
margin-top:15px; 
margin-bottom:15px;}


</style>

